// IsLineBreakAmbiguous reports whether the rune has property "Line_Break"="Ambiguous".
// Property "Line_Break" known as "lb", "Line_Break".
// Value "Ambiguous" known as "AI", "Ambiguous".
func IsLineBreakAmbiguous(r rune) bool {
	const lo = 0xa7
	const hi = 0x1f1ac
	if r < lo || r > hi {
		return false
	}
	var i = (r - lo) / 64
	var shift = (r - lo) % 64
	return dataArrayIsLineBreakAmbiguous[i]&(1<<uint(shift)) != 0
}

